import Grid from '@material-ui/core/Grid';
import React from 'react';
import 'rsuite/dist/styles/rsuite-default.css';

const ContactInfo=():JSX.Element=>{
    const output:any=[];

     const contactinfo:any=[{
       email:"facebook-square.com",
       conatcNuber:"9371084258",

    },
    {
       email:"linkedin-square.com",
       contactNumber:"9371084258",
    },

]


    const getContactInfo=()=>{
      Array.isArray(contactinfo) && contactinfo.forEach((items)=>{
        output.push( <Grid item lg={3}  justify="center" alignItems="center">
            {items.email}
            <br/>
            {items.contactNumber}
        </Grid>)
      })
      return output;
    }

    return(
        <div>
   {getContactInfo()}
        </div>
    )
}

export default ContactInfo;
